[{"location":"literated/single_column_nutrients_plankton_bacteria_detritus/","page":"Single column nutrients, plankton, bacteria, detritus","title":"Single column nutrients, plankton, bacteria, detritus","text":"EditURL = \"https://github.com/CliMA/ClimaOceanBiogeochemistry.jl/blob/main/examples/single_column_nutrients_plankton_bacteria_detritus.jl\"","category":"page"},{"location":"literated/single_column_nutrients_plankton_bacteria_detritus/#Nutrients,-plankton,-bacteria,-detritus","page":"Single column nutrients, plankton, bacteria, detritus","title":"Nutrients, plankton, bacteria, detritus","text":"","category":"section"},{"location":"literated/single_column_nutrients_plankton_bacteria_detritus/","page":"Single column nutrients, plankton, bacteria, detritus","title":"Single column nutrients, plankton, bacteria, detritus","text":"This example illustrates how to use ClimaOceanBiogeochemistry's NutrientsPlanktonBacteriaDetrius model in a single column context.","category":"page"},{"location":"literated/single_column_nutrients_plankton_bacteria_detritus/","page":"Single column nutrients, plankton, bacteria, detritus","title":"Single column nutrients, plankton, bacteria, detritus","text":"using ClimaOceanBiogeochemistry: NutrientsPlanktonBacteriaDetritus\n\nusing Oceananigans\nusing Oceananigans.Units\nusing Oceananigans.TurbulenceClosures: CATKEVerticalDiffusivity\nusing Printf\nusing CairoMakie","category":"page"},{"location":"literated/single_column_nutrients_plankton_bacteria_detritus/#A-single-column-grid","page":"Single column nutrients, plankton, bacteria, detritus","title":"A single column grid","text":"","category":"section"},{"location":"literated/single_column_nutrients_plankton_bacteria_detritus/","page":"Single column nutrients, plankton, bacteria, detritus","title":"Single column nutrients, plankton, bacteria, detritus","text":"We set up a single column grid with 4 m grid spacing that's 256 m deep:","category":"page"},{"location":"literated/single_column_nutrients_plankton_bacteria_detritus/","page":"Single column nutrients, plankton, bacteria, detritus","title":"Single column nutrients, plankton, bacteria, detritus","text":"grid = RectilinearGrid(size = 100,\n                       z = (-1000, 0),\n                       topology = (Flat, Flat, Bounded))","category":"page"},{"location":"literated/single_column_nutrients_plankton_bacteria_detritus/#Convection-then-quiet","page":"Single column nutrients, plankton, bacteria, detritus","title":"Convection then quiet","text":"","category":"section"},{"location":"literated/single_column_nutrients_plankton_bacteria_detritus/","page":"Single column nutrients, plankton, bacteria, detritus","title":"Single column nutrients, plankton, bacteria, detritus","text":"To illustrate the dynamics of NutrientsPlanktonBacteriaDetritus, we set up a physical scenario in which strong convection drives turbulent mixing for 4 days, and then abruptly shuts off. Once the convective turbulence dies down, plankton start to grow.","category":"page"},{"location":"literated/single_column_nutrients_plankton_bacteria_detritus/","page":"Single column nutrients, plankton, bacteria, detritus","title":"Single column nutrients, plankton, bacteria, detritus","text":"Qᵇ(x, y, t) = ifelse(t < 4days, 1e-7, 0.0)\nb_bcs = FieldBoundaryConditions(top = FluxBoundaryCondition(Qᵇ))","category":"page"},{"location":"literated/single_column_nutrients_plankton_bacteria_detritus/","page":"Single column nutrients, plankton, bacteria, detritus","title":"Single column nutrients, plankton, bacteria, detritus","text":"We put the pieces together. The important line here is biogeochemistry = NutrientsPlanktonBacteriaDetritus(). We use all default parameters.","category":"page"},{"location":"literated/single_column_nutrients_plankton_bacteria_detritus/","page":"Single column nutrients, plankton, bacteria, detritus","title":"Single column nutrients, plankton, bacteria, detritus","text":"biogeochemistry = NutrientsPlanktonBacteriaDetritus(maximum_bacteria_growth_rate = 10/day)\n\nmodel = HydrostaticFreeSurfaceModel(; grid, biogeochemistry,\n                                    closure = CATKEVerticalDiffusivity(),\n                                    tracers = (:b, :e),\n                                    buoyancy = BuoyancyTracer(),\n                                    boundary_conditions = (; b=b_bcs))","category":"page"},{"location":"literated/single_column_nutrients_plankton_bacteria_detritus/#Initial-conditions","page":"Single column nutrients, plankton, bacteria, detritus","title":"Initial conditions","text":"","category":"section"},{"location":"literated/single_column_nutrients_plankton_bacteria_detritus/","page":"Single column nutrients, plankton, bacteria, detritus","title":"Single column nutrients, plankton, bacteria, detritus","text":"We initialize the model with reasonable nutrients, detritus, and a nutrient mixed layer.","category":"page"},{"location":"literated/single_column_nutrients_plankton_bacteria_detritus/","page":"Single column nutrients, plankton, bacteria, detritus","title":"Single column nutrients, plankton, bacteria, detritus","text":"N₀ = 1e-1 # Surface nutrient concentration\nD₀ = 1e-1 # Surface detritus concentration\ndᴺ = 50.0 # Nutrient mixed layer depth\nN² = 1e-5 # Buoyancy gradient, s⁻²\n\nbᵢ(x, y, z) = N² * z\n#Nᵢ(x, y, z) = N₀ * max(1, exp(-(z + dᴺ) / 100))\nDᵢ(x, y, z) = D₀ * exp(z / 10)\n\nset!(model, b=bᵢ, P=1e-1, B=1e-1, D=Dᵢ, N=10, e=1e-6)","category":"page"},{"location":"literated/single_column_nutrients_plankton_bacteria_detritus/#A-simulation-of-physical-biological-interaction","page":"Single column nutrients, plankton, bacteria, detritus","title":"A simulation of physical-biological interaction","text":"","category":"section"},{"location":"literated/single_column_nutrients_plankton_bacteria_detritus/","page":"Single column nutrients, plankton, bacteria, detritus","title":"Single column nutrients, plankton, bacteria, detritus","text":"We construct a simple simulation that emits a message every 10 iterations and outputs tracer fields.","category":"page"},{"location":"literated/single_column_nutrients_plankton_bacteria_detritus/","page":"Single column nutrients, plankton, bacteria, detritus","title":"Single column nutrients, plankton, bacteria, detritus","text":"simulation = Simulation(model, Δt=10minutes, stop_time=3days)\n\nprogress(sim) = @printf(\"Iteration: %d, time: %s, TotalN: %.2e \\n\",\n                        iteration(sim), prettytime(sim),\n                        sum(model.tracers.N)+sum(model.tracers.P)+sum(model.tracers.B)+sum(model.tracers.D))\n\nsimulation.callbacks[:progress] = Callback(progress, IterationInterval(10))\n\nfilename = \"nutrients_plankton_bacteria_detritus.jld2\"\n\nsimulation.output_writers[:fields] = JLD2OutputWriter(model, model.tracers;\n                                                      filename,\n                                                      schedule = TimeInterval(20minutes),\n                                                      overwrite_existing = true)\n\nrun!(simulation)","category":"page"},{"location":"literated/single_column_nutrients_plankton_bacteria_detritus/#Visualization","page":"Single column nutrients, plankton, bacteria, detritus","title":"Visualization","text":"","category":"section"},{"location":"literated/single_column_nutrients_plankton_bacteria_detritus/","page":"Single column nutrients, plankton, bacteria, detritus","title":"Single column nutrients, plankton, bacteria, detritus","text":"All that's left is to visualize the results.","category":"page"},{"location":"literated/single_column_nutrients_plankton_bacteria_detritus/","page":"Single column nutrients, plankton, bacteria, detritus","title":"Single column nutrients, plankton, bacteria, detritus","text":"bt = FieldTimeSeries(filename, \"b\")\net = FieldTimeSeries(filename, \"e\")\nPt = FieldTimeSeries(filename, \"P\")\nBt = FieldTimeSeries(filename, \"B\")\nDt = FieldTimeSeries(filename, \"D\")\nNt = FieldTimeSeries(filename, \"N\")\n\nt = bt.times\nnt = length(t)\nz = znodes(bt)\n\nfig = Figure(resolution=(1200, 600))\n\naxb = Axis(fig[1, 1], ylabel=\"z (m)\", xlabel=\"Buoyancy (m² s⁻³)\")\naxe = Axis(fig[1, 2], ylabel=\"z (m)\", xlabel=\"Turbulent kinetic energy (m² s²)\")\naxP = Axis(fig[1, 3], ylabel=\"z (m)\", xlabel=\"Concentration (mmol)\")\naxN = Axis(fig[1, 4], ylabel=\"z (m)\", xlabel=\"Nutrient concentration (mmol)\")\n\nxlims!(axe, -1e-5, 1e-3)\nxlims!(axP, 0, 0.2)\n\nslider = Slider(fig[2, 1:4], range=1:nt, startvalue=1)\nn = slider.value\n\ntitle = @lift @sprintf(\"t = %d days\", t[$n] / day)\nLabel(fig[0, 1:4], title)\n\nbn = @lift interior(bt[$n], 1, 1, :)\nen = @lift interior(et[$n], 1, 1, :)\nPn = @lift interior(Pt[$n], 1, 1, :)\nBn = @lift interior(Bt[$n], 1, 1, :)\nDn = @lift interior(Dt[$n], 1, 1, :)\nNn = @lift interior(Nt[$n], 1, 1, :)\n\nlines!(axb, bn, z)\nlines!(axe, en, z)\n\nlines!(axP, Pn, z, label=\"Plankton\")\nlines!(axP, Dn, z, label=\"Detritus\")\nlines!(axP, Bn, z, label=\"Bacteria\")\naxislegend(axP)\n\nlines!(axN, Nn, z)\n\n#record(fig, \"nutrients_plankton_bacteria_detritus.mp4\", 1:nt, framerate=24) do nn\nrecord(fig, \"nutrients_plankton_bacteria_detritus.mp4\", 1:nt, framerate=24) do nn\n    n[] = nn\nend\n#nothing #hide","category":"page"},{"location":"literated/single_column_nutrients_plankton_bacteria_detritus/","page":"Single column nutrients, plankton, bacteria, detritus","title":"Single column nutrients, plankton, bacteria, detritus","text":"(Image: )","category":"page"},{"location":"literated/single_column_nutrients_plankton_bacteria_detritus/","page":"Single column nutrients, plankton, bacteria, detritus","title":"Single column nutrients, plankton, bacteria, detritus","text":"","category":"page"},{"location":"literated/single_column_nutrients_plankton_bacteria_detritus/","page":"Single column nutrients, plankton, bacteria, detritus","title":"Single column nutrients, plankton, bacteria, detritus","text":"This page was generated using Literate.jl.","category":"page"},{"location":"library/function_index/#main-index","page":"Function index","title":"Index","text":"","category":"section"},{"location":"library/function_index/","page":"Function index","title":"Function index","text":"Pages = [\"public.md\", \"internals.md\", \"function_index.md\"]","category":"page"},{"location":"library/outline/#Library-Outline","page":"Contents","title":"Library Outline","text":"","category":"section"},{"location":"library/outline/","page":"Contents","title":"Contents","text":"Pages = [\"public.md\", \"internals.md\", \"function_index.md\"]","category":"page"},{"location":"library/internals/#Private-types-and-functions","page":"Private","title":"Private types and functions","text":"","category":"section"},{"location":"library/internals/","page":"Private","title":"Private","text":"Documentation for ClimaOceanBiogeochemistry.jl's internal interface.","category":"page"},{"location":"library/internals/#ClimaOceanBiogeochemistry","page":"Private","title":"ClimaOceanBiogeochemistry","text":"","category":"section"},{"location":"library/internals/","page":"Private","title":"Private","text":"Modules = [ClimaOceanBiogeochemistry, \n           ClimaOceanBiogeochemistry.CarbonSystemSolvers,\n           ClimaOceanBiogeochemistry.CarbonSystemSolvers.AlkalinityCorrectionCarbonSolver,\n           ClimaOceanBiogeochemistry.CarbonSystemSolvers.DirectCubicCarbonSolver]\nPublic  = false","category":"page"},{"location":"library/internals/#ClimaOceanBiogeochemistry.CAN-Tuple{Any, Any, Any, Any, Val{:Alk}, Any, Any}","page":"Private","title":"ClimaOceanBiogeochemistry.CAN","text":"Tracer sources and sinks for ALK\n\n\n\n\n\n","category":"method"},{"location":"library/internals/#ClimaOceanBiogeochemistry.CAN-Tuple{Any, Any, Any, Any, Val{:DIC}, Any, Any}","page":"Private","title":"ClimaOceanBiogeochemistry.CAN","text":"Tracer sources and sinks for DIC\n\n\n\n\n\n","category":"method"},{"location":"library/internals/#ClimaOceanBiogeochemistry.CAN-Tuple{Any, Any, Any, Any, Val{:DOP}, Any, Any}","page":"Private","title":"ClimaOceanBiogeochemistry.CAN","text":"Tracer sources and sinks for DOP\n\n\n\n\n\n","category":"method"},{"location":"library/internals/#ClimaOceanBiogeochemistry.CAN-Tuple{Any, Any, Any, Any, Val{:Fe}, Any, Any}","page":"Private","title":"ClimaOceanBiogeochemistry.CAN","text":"Tracer sources and sinks for FeT\n\n\n\n\n\n","category":"method"},{"location":"library/internals/#ClimaOceanBiogeochemistry.CAN-Tuple{Any, Any, Any, Any, Val{:NO₃}, Any, Any}","page":"Private","title":"ClimaOceanBiogeochemistry.CAN","text":"Tracer sources and sinks for NO₃\n\n\n\n\n\n","category":"method"},{"location":"library/internals/#ClimaOceanBiogeochemistry.CAN-Tuple{Any, Any, Any, Any, Val{:PO₄}, Any, Any}","page":"Private","title":"ClimaOceanBiogeochemistry.CAN","text":"Tracer sources and sinks for PO₄\n\n\n\n\n\n","category":"method"},{"location":"library/internals/#ClimaOceanBiogeochemistry.CarbonAlkalinityNutrients","page":"Private","title":"ClimaOceanBiogeochemistry.CarbonAlkalinityNutrients","text":"CarbonAlkalinityNutrients(; kw...)\n\nReturn a six-tracer biogeochemistry model for the interaction of carbon, alkalinity, and nutrients.\n\nParameters\n\nTracer names\n\nDIC: Dissolved Inorganic Carbon\nAlk: Alkalinity\nPO₄: Phosphate (macronutrient)\nNO₃: Nitrate (macronutrient)\nDOP: Dissolved Organic Phosphate (macronutrient)\nFe: Dissolved Iron (micronutrient)\n\nBiogeochemical functions\n\ntransitions for DIC, Alk, PO₄, NO₃, DOP, and Fe\nbiogeochemical_drift_velocity for D, modeling the sinking of detritus at a constant detritus_sinking_speed.\n\n\n\n\n\n","category":"type"},{"location":"library/internals/#ClimaOceanBiogeochemistry.NutrientsPlanktonBacteriaDetritus","page":"Private","title":"ClimaOceanBiogeochemistry.NutrientsPlanktonBacteriaDetritus","text":"NutrientsPlanktonBacteriaDetritus(; kw...)\n\nReturn a four-tracer biogeochemistry model for the interaction of nutrients, plankton bacteria, and detritus.\n\nParameters\n\nmaximum_plankton_growth_rate: (s⁻¹) Growth rate of plankton P unlimited by the                                  availability of nutrients and light. Default: 1/day.\nmaximum_bacteria_growth_rate: (s⁻¹) Growth rate of plankton B unlimited by the                                 availability of nutrients and light. Default = 0.5/day.\nbacteria_yield: Determines fractional nutrient production by bacteria production                   relative to consumption of detritus such that _t N  _t D = 1 - y,                   where y = bacteria_yield. Default: 0.2.\nquadratic_mortality_rate: (s⁻¹) Mortality rate of both plankton and bacteria.\nnutrient_half_saturation: (mmol m⁻³) Half-saturation of nutrients for plankton production.\ndetritus_half_saturation: (mmol m⁻³) Half-saturation of nutrients for bacteria production.                             Deafult = 10.0 mmol m⁻³.\nPAR_half_saturation: (Nondimensionalized from W m⁻²) Half-saturation of photosynthetically available radiation (PAR)                        for plankton production.\nPAR_attenuation_scale: (m) Depth scale over which photosynthetically available radiation (PAR)                          attenuates exponentially.\ndetritus_sinking_speed: (m s⁻¹) Sinking velocity of detritus.\n\nTracer names\n\nN: nutrients\nP: plankton\nB: bacteria\nD: detritus\n\nBiogeochemical functions\n\ntransitions for N, P, B, D\nbiogeochemical_drift_velocity for D, modeling the sinking of detritus at a constant detritus_sinking_speed.\n\n\n\n\n\n","category":"type"},{"location":"library/internals/#ClimaOceanBiogeochemistry.iron_scavenging-NTuple{4, Any}","page":"Private","title":"ClimaOceanBiogeochemistry.iron_scavenging","text":"Iron scavenging should depend on free iron, involves solving a quadratic equation in terms of ligand concentration and stability coefficient, but this is a simple first order approximation.\n\n\n\n\n\n","category":"method"},{"location":"library/internals/#ClimaOceanBiogeochemistry.CarbonSystemSolvers.CarbonChemistryCoefficients-Tuple{Any, Any, Any}","page":"Private","title":"ClimaOceanBiogeochemistry.CarbonSystemSolvers.CarbonChemistryCoefficients","text":"CarbonChemistryCoefficients(Θᶜ, Sᴬ, Δpᵦₐᵣ)\n\nReturn dissociation coefficients necessary to solve for the distribution of carbonate species.\n\n\n\n\n\n","category":"method"},{"location":"library/internals/#ClimaOceanBiogeochemistry.CarbonSystemSolvers.Bᵀᴼᵀ","page":"Private","title":"ClimaOceanBiogeochemistry.CarbonSystemSolvers.Bᵀᴼᵀ","text":"Bᵀᴼᵀ(Sᵖ, Pᴮᵀᴼᵀ)\n\nReturn total borate concentration in mol/kg-SW given practical salinity, Sᵖ. References: Uppström (1974), cited by  Dickson et al. (2007, chapter 5, p 10)             Millero (1982) cited in Millero (1995)\n\n\n\n\n\n","category":"function"},{"location":"library/internals/#ClimaOceanBiogeochemistry.CarbonSystemSolvers.Caᵀᴼᵀ","page":"Private","title":"ClimaOceanBiogeochemistry.CarbonSystemSolvers.Caᵀᴼᵀ","text":"Caᵀᴼᵀ(Sᵖ, Pᶜᵃᵀᴼᵀ)\n\nReturn calcium concentration in mol/kg-SW given practical salinity, Sᵖ. References: Culkin and Cox (1966),              Culkin (1967),              Riley and Tongudai (1967)    \n\n\n\n\n\n","category":"function"},{"location":"library/internals/#ClimaOceanBiogeochemistry.CarbonSystemSolvers.FCᵀCO₂ˢᵒˡ-Tuple{Any, Any, Any}","page":"Private","title":"ClimaOceanBiogeochemistry.CarbonSystemSolvers.FCᵀCO₂ˢᵒˡ","text":"FCᵀCO₂ˢᵒˡ(Cᵀ, pH, Pᶜᵒᵉᶠᶠ)\n\nCalculate the dissolved and hydrated CO₂ concentration in seawater given the total carbon concentration Cᵀ, pH, and the carbon chemistry coefficients.\n\n\n\n\n\n","category":"method"},{"location":"library/internals/#ClimaOceanBiogeochemistry.CarbonSystemSolvers.FCᵀCO₃²⁻-Tuple{Any, Any, Any}","page":"Private","title":"ClimaOceanBiogeochemistry.CarbonSystemSolvers.FCᵀCO₃²⁻","text":"FCᵀCO₃²⁻(Cᵀ, pH, Pᶜᵒᵉᶠᶠ)\n\nCalculate the carbonate concentration in seawater given the total carbon concentration Cᵀ, pH, and the carbon chemistry coefficients.\n\n\n\n\n\n","category":"method"},{"location":"library/internals/#ClimaOceanBiogeochemistry.CarbonSystemSolvers.FCᵀHCO₃⁻-Tuple{Any, Any, Any}","page":"Private","title":"ClimaOceanBiogeochemistry.CarbonSystemSolvers.FCᵀHCO₃⁻","text":"FCᵀHCO₃⁻(Cᵀ, pH, Pᶜᵒᵉᶠᶠ)\n\nCalculate the bicarbonate ion concentration in seawater given the total carbon concentration Cᵀ, pH, and the carbon chemistry coefficients.\n\n\n\n\n\n","category":"method"},{"location":"library/internals/#ClimaOceanBiogeochemistry.CarbonSystemSolvers.FpCO₂CO₂ˢᵒˡ-Tuple{Any, Any}","page":"Private","title":"ClimaOceanBiogeochemistry.CarbonSystemSolvers.FpCO₂CO₂ˢᵒˡ","text":"FpCO₂CO₂ˢᵒˡ(pCO₂, pH, Pᶜᵒᵉᶠᶠ)\n\nCalculate the dissolved and hydrated CO₂ concentration in seawater given the pCO₂, pH, and the carbon chemistry coefficients.\n\n\n\n\n\n","category":"method"},{"location":"library/internals/#ClimaOceanBiogeochemistry.CarbonSystemSolvers.FpCO₂CO₃²⁻-Tuple{Any, Any, Any}","page":"Private","title":"ClimaOceanBiogeochemistry.CarbonSystemSolvers.FpCO₂CO₃²⁻","text":"FpCO₂CO₃²⁻(pCO₂, pH, Pᶜᵒᵉᶠᶠ)\n\nCalculate the carbonate concentration in seawater given the pCO₂, pH, and the carbon chemistry coefficients.\n\n\n\n\n\n","category":"method"},{"location":"library/internals/#ClimaOceanBiogeochemistry.CarbonSystemSolvers.FpCO₂HCO₃⁻-Tuple{Any, Any, Any}","page":"Private","title":"ClimaOceanBiogeochemistry.CarbonSystemSolvers.FpCO₂HCO₃⁻","text":"FpCO₂HCO₃⁻(pCO₂, pH, Pᶜᵒᵉᶠᶠ)\n\nCalculate the bicarbonate ion concentration in seawater given the pCO₂, pH, and the carbon chemistry coefficients.\n\n\n\n\n\n","category":"method"},{"location":"library/internals/#ClimaOceanBiogeochemistry.CarbonSystemSolvers.Fˢⁱᵗₖ₁","page":"Private","title":"ClimaOceanBiogeochemistry.CarbonSystemSolvers.Fˢⁱᵗₖ₁","text":"Fˢⁱᵗₖ₁(Θᴷ, Sᵖ, Δpᵦₐᵣ, Pˢⁱᵗₖ₁)\n\nReturn the first dissociation constant of silicic acid (H4SiO4) in seawater, given  temperature in K, Θᴷ, practical salinity, Sᵖ, applied pressure, Δpᵦₐᵣ, and coefficients, Pˢⁱᵗₖ₁.\n\nReferences: Yao and Millero (1995) cited by Millero (1995) pH scale  : SWS (according to Dickson et al, 2007) Note      : No pressure correction available Note      : converted here from mol/kg-H2O to mol/kg-sw\n\n\n\n\n\n","category":"function"},{"location":"library/internals/#ClimaOceanBiogeochemistry.CarbonSystemSolvers.Fᴴ²ˢₖ₁","page":"Private","title":"ClimaOceanBiogeochemistry.CarbonSystemSolvers.Fᴴ²ˢₖ₁","text":"Fᴴ²ˢₖ₁(Θᴷ, Sᵖ, Δpᵦₐᵣ, Pᴴ²ˢₖ₁)\n\nReturn the dissociation constant of hydrogen sulfide in sea-water, given temperature in K, Θᴷ, practical salinity, Sᵖ, applied pressure, Δpᵦₐᵣ, and coefficients, Pᴴ²ˢₖ₁.\n\nReferences: Millero et al. (1988) (cited by Millero (1995)             Millero (1995) for pressure correction pH scale  : - SWS (according to Yao and Millero, 1995, p. 82: \"refitted if necessary\")             - Total (according to Lewis and Wallace, 1998) Note      : we stick to SWS here for the time being Note      : the fits from Millero (1995) and Yao and Millero (1995)             derive from Millero et al. (1988), with all the coefficients             multiplied by -ln(10)\n\n\n\n\n\n","category":"function"},{"location":"library/internals/#ClimaOceanBiogeochemistry.CarbonSystemSolvers.Fᴴ²ᴼₖ₁","page":"Private","title":"ClimaOceanBiogeochemistry.CarbonSystemSolvers.Fᴴ²ᴼₖ₁","text":"Fᴴ²ᴼₖ₁(Θᴷ, Sᵖ, Δpᵦₐᵣ, Pᴴ²ᴼₖ₁)\n\nReturn dissociation constant of water in (mol/kg-SW)^2, given temperature in K, Θᴷ, practical salinity, Sᵖ, applied pressure, Δpᵦₐᵣ, and coefficients, Pᴴ²ᴼₖ₁.\n\nReferences: Millero (1995) for value at p_bar = 0             Millero (pers. comm. 1996) for pressure correction pH scale  : SWS\n\n\n\n\n\n","category":"function"},{"location":"library/internals/#ClimaOceanBiogeochemistry.CarbonSystemSolvers.Fᴴˢᴼ⁴ₖ₁","page":"Private","title":"ClimaOceanBiogeochemistry.CarbonSystemSolvers.Fᴴˢᴼ⁴ₖ₁","text":"Fᴴˢᴼ⁴ₖ₁(Θᴷ, Sᵖ, Δpᵦₐᵣ, Pᴴˢᴼ⁴ₖ₁)\n\nReturn the dissociation constant of hydrogen sulfate (bisulfate) , given temperature in K, Θᴷ, practical salinity, Sᵖ, applied pressure, Δpᵦₐᵣ, and coefficients, Pᴴˢᴼ⁴ₖ₁.\n\nReferences: Dickson (1990) – also Handbook (2007)             Millero (1995) for pressure correction pH scale  : free Note      : converted here from mol/kg-H2O to mol/kg-SW\n\n\n\n\n\n","category":"function"},{"location":"library/internals/#ClimaOceanBiogeochemistry.CarbonSystemSolvers.Fᴴᶠᵦ₁","page":"Private","title":"ClimaOceanBiogeochemistry.CarbonSystemSolvers.Fᴴᶠᵦ₁","text":"Fᴴᶠᵦ₁(Θᴷ, Sᵖ, Δpᵦₐᵣ, Pᴴᶠᵦ₁)\n\nReturn the association constant of HF in (mol/kg-SW)^-1, given temperature in K, Θᴷ, practical salinity, Sᵖ, applied pressure, Δpᵦₐᵣ, and coefficients, Pᴴᶠᵦ₁.\n\nHF <-> H⁺ + F⁻ \n\nReferences: Dickson and Riley (1979)             Millero (1995) for pressure correction pH scale  : free Note      : converted here from mol/kg-H2O to mol/kg-SW\n\n\n\n\n\n","category":"function"},{"location":"library/internals/#ClimaOceanBiogeochemistry.CarbonSystemSolvers.Fᴴᶠₖ₁","page":"Private","title":"ClimaOceanBiogeochemistry.CarbonSystemSolvers.Fᴴᶠₖ₁","text":"Fᴴᶠₖ₁(Θᴷ, Sᵖ, Δpᵦₐᵣ, Pᴴᶠₖ₁)\n\nReturn the dissociation constant for hydrogen fluoride in mol/kg-SW, given temperature in K, Θᴷ, practical salinity, Sᵖ, applied pressure, Δpᵦₐᵣ, and coefficients, Pᴴᶠₖ₁.\n\nHF <-> H⁺ + F⁻ \n\nReferences: Perez and Fraga (1987)             Millero (1995) for pressure correction pH scale  : Total (according to Handbook, 2007\n\n\n\n\n\n","category":"function"},{"location":"library/internals/#ClimaOceanBiogeochemistry.CarbonSystemSolvers.Fᴺᴴ⁴ₖ₁","page":"Private","title":"ClimaOceanBiogeochemistry.CarbonSystemSolvers.Fᴺᴴ⁴ₖ₁","text":"Fᴺᴴ⁴ₖ₁(Θᴷ, Sᵖ, Δpᵦₐᵣ, Pᴺᴴ⁴ₖ₁)\n\nReturn the dissociation constant of ammonium in sea-water [mol/kg-SW], given temperature in K, Θᴷ, practical salinity, Sᵖ, applied pressure, Δpᵦₐᵣ, and coefficients, Pᴺᴴ⁴ₖ₁.\n\nReferences: Yao and Millero (1995)             Millero (1995) for pressure correction pH scale  : SWS\n\n\n\n\n\n","category":"function"},{"location":"library/internals/#ClimaOceanBiogeochemistry.CarbonSystemSolvers.Fᴾᴼ⁴ₖ₁","page":"Private","title":"ClimaOceanBiogeochemistry.CarbonSystemSolvers.Fᴾᴼ⁴ₖ₁","text":"Fᴾᴼ⁴ₖ₁(Θᴷ, Sᵖ, Δpᵦₐᵣ, Pᴾᴼ⁴ₖ₁)\n\nReturn the first dissociation constant of phosphoric acid (H3PO4) in seawater, given  temperature in K, Θᴷ, practical salinity, Sᵖ, applied pressure, Δpᵦₐᵣ, and coefficients, Pᴾᴼ⁴ₖ₁.\n\nReferences: Yao and Millero (1995)             Millero (1995) for pressure correction pH scale  : SWS\n\n\n\n\n\n","category":"function"},{"location":"library/internals/#ClimaOceanBiogeochemistry.CarbonSystemSolvers.Fᴾᴼ⁴ₖ₂","page":"Private","title":"ClimaOceanBiogeochemistry.CarbonSystemSolvers.Fᴾᴼ⁴ₖ₂","text":"Fᴾᴼ⁴ₖ₂(Θᴷ, Sᵖ, Δpᵦₐᵣ, Pᴾᴼ⁴ₖ₂)\n\nReturn the second dissociation constant of phosphoric acid (H3PO4) in seawater, given temperature in K, Θᴷ, practical salinity, Sᵖ, applied pressure, Δpᵦₐᵣ, and coefficients, Pᴾᴼ⁴ₖ₂.\n\nReferences: Yao and Millero (1995)             Millero (1995) for pressure correction pH scale  : SWS\n\n\n\n\n\n","category":"function"},{"location":"library/internals/#ClimaOceanBiogeochemistry.CarbonSystemSolvers.Fᴾᴼ⁴ₖ₃","page":"Private","title":"ClimaOceanBiogeochemistry.CarbonSystemSolvers.Fᴾᴼ⁴ₖ₃","text":"Fᴾᴼ⁴ₖ₃(Θᴷ, Sᵖ, Δpᵦₐᵣ, Pᴾᴼ⁴ₖ₃)\n\nReturn the third dissociation constant of phosphoric acid (H3PO4) in seawater, given  temperature in K, Θᴷ, practical salinity, Sᵖ, applied pressure, Δpᵦₐᵣ, and coefficients, Pᴾᴼ⁴ₖ₃.\n\nReferences: Yao and Millero (1995)             Millero (1995) for pressure correction pH scale  : SWS\n\n\n\n\n\n","category":"function"},{"location":"library/internals/#ClimaOceanBiogeochemistry.CarbonSystemSolvers.Fᵀᴼᵀ","page":"Private","title":"ClimaOceanBiogeochemistry.CarbonSystemSolvers.Fᵀᴼᵀ","text":"Fᵀᴼᵀ(Sᵖ, Pᶠᵀᴼᵀ)\n\nReturn total fluoride concentration in mol/kg-SW given practical salinity, Sᵖ. References: Culkin (1965) (???)\n\n\n\n\n\n","category":"function"},{"location":"library/internals/#ClimaOceanBiogeochemistry.CarbonSystemSolvers.Fᵃʳᵃᵍᵒⁿⁱᵗᵉₛₚ","page":"Private","title":"ClimaOceanBiogeochemistry.CarbonSystemSolvers.Fᵃʳᵃᵍᵒⁿⁱᵗᵉₛₚ","text":"Fᵃʳᵃᵍᵒⁿⁱᵗᵉₛₚ(Θᴷ, Sᵖ, Δpᵦₐᵣ, Pᵃʳᵃᵍᵒⁿⁱᵗᵉₛₚ)\n\nReturn stoichiometric solubility product, Ω, of aragonite in seawater, given temperature in K, Θᴷ, practical salinity, Sᵖ, applied pressure, Δpᵦₐᵣ, and coefficients, Pᵃʳᵃᵍᵒⁿⁱᵗᵉₛₚ.\n\nReferences: Mucci (1983)             Millero (1979) for pressure correction pH scale  : N/A Units     : (mol/kg-SW)^2\n\n\n\n\n\n","category":"function"},{"location":"library/internals/#ClimaOceanBiogeochemistry.CarbonSystemSolvers.Fᵇₖ₁","page":"Private","title":"ClimaOceanBiogeochemistry.CarbonSystemSolvers.Fᵇₖ₁","text":"Fᵇₖ₁(Θᴷ, Sᵖ, Δpᵦₐᵣ, Pᴮₖ₁)\n\nReturn boric acid dissociation constant in mol/kg-SW, given temperature in K, Θᴷ, practical salinity, Sᵖ, applied pressure, Δpᵦₐᵣ, and coefficients, Pᴮₖ₁.\n\nReferences: Dickson (1990, eq. 23) – also Handbook (2007, eq. 37)             Millero (1979) pressure correction pH scale  : total\n\n\n\n\n\n","category":"function"},{"location":"library/internals/#ClimaOceanBiogeochemistry.CarbonSystemSolvers.Fᵈⁱᶜₖ₀","page":"Private","title":"ClimaOceanBiogeochemistry.CarbonSystemSolvers.Fᵈⁱᶜₖ₀","text":"Fᵈⁱᶜₖ₀(Θᴷ, Sᵖ, Pᵈⁱᶜₖ₀)\n\nReturn hydration constant of CO₂ in (mol/kg-SW)/atm given temperature  in K, Θᴷ, practical salinity, Sᵖ, and coefficients, Pᵈⁱᶜₖ₀.\n\nCO₂ + H₂O <-> H₂CO₃\n\nReferences: Weiss (1979) pH scale  : N/A Note      : currently no pressure correction\n\n\n\n\n\n","category":"function"},{"location":"library/internals/#ClimaOceanBiogeochemistry.CarbonSystemSolvers.Fᵈⁱᶜₖ₁ᵣ₉₃","page":"Private","title":"ClimaOceanBiogeochemistry.CarbonSystemSolvers.Fᵈⁱᶜₖ₁ᵣ₉₃","text":"Fᵈⁱᶜₖ₁ᵣ₉₃(Θᴷ, Sᵖ, Δpᵦₐᵣ, Pᵈⁱᶜₖ₁ᵣ₉₃)\n\nReturn the first dissociation constant of carbonic acid in mol/kg-SW, given temperature in K, Θᴷ, practical salinity, Sᵖ, applied pressure,  Δpᵦₐᵣ, and coefficients, Pᵈⁱᶜₖ₁ᵣ₉₃.\n\nH₂CO₃ <-> HCO₃⁻ + H⁺\n\nReferences: Roy et al. (1993) – also Handbook (1994)             Millero (1979) pressure correction pH scale  : Total Valid range: T:  0-45  S:  5-45. Note      : converted here from mol/kg-H2O to mol/kg-SW\n\n\n\n\n\n","category":"function"},{"location":"library/internals/#ClimaOceanBiogeochemistry.CarbonSystemSolvers.Fᵈⁱᶜₖ₁ₗ₀₀","page":"Private","title":"ClimaOceanBiogeochemistry.CarbonSystemSolvers.Fᵈⁱᶜₖ₁ₗ₀₀","text":"Fᵈⁱᶜₖ₁ₗ₀₀(Θᴷ, Sᵖ, Δpᵦₐᵣ, Pᵈⁱᶜₖ₁ₗ₀₀)\n\nReturn the first dissociation constant of carbonic acid in mol/kg-SW, given temperature in K, Θᴷ, practical salinity, Sᵖ, applied pressure,  Δpᵦₐᵣ, and coefficients, Pᵈⁱᶜₖ₁ₗ₀₀.\n\nH₂CO₃ <-> HCO₃⁻ + H⁺\n\nReferences: Luecker et al. (2000) – also Handbook (2007)             Millero (1979) pressure correction pH scale:   Total\n\n\n\n\n\n","category":"function"},{"location":"library/internals/#ClimaOceanBiogeochemistry.CarbonSystemSolvers.Fᵈⁱᶜₖ₁ₘ₉₅","page":"Private","title":"ClimaOceanBiogeochemistry.CarbonSystemSolvers.Fᵈⁱᶜₖ₁ₘ₉₅","text":"Fᵈⁱᶜₖ₁ₘ₉₅(Θᴷ, Sᵖ, Δpᵦₐᵣ, Pᵈⁱᶜₖ₁ₘ₉₅)\n\nReturn the first dissociation constant of carbonic acid in mol/kg-SW, given temperature in K, Θᴷ, practical salinity, Sᵖ, applied pressure,  Δpᵦₐᵣ, and coefficients, Pᵈⁱᶜₖ₁ₘ₉₅.\n\nH₂CO₃ <-> HCO₃⁻ + H⁺\n\nReferences: Millero (1995, eq 50 – ln K1(COM))              Millero (1982) pressure correction pH scale:   SWS\n\n\n\n\n\n","category":"function"},{"location":"library/internals/#ClimaOceanBiogeochemistry.CarbonSystemSolvers.Fᵈⁱᶜₖ₂ᵣ₉₃","page":"Private","title":"ClimaOceanBiogeochemistry.CarbonSystemSolvers.Fᵈⁱᶜₖ₂ᵣ₉₃","text":"Fᵈⁱᶜₖ₂ᵣ₉₃(Θᴷ, Sᵖ, Δpᵦₐᵣ, Pᵈⁱᶜₖ₂ᵣ₉₃)\n\nReturn the second dissociation constant of carbonic acid in mol/kg-SW, given temperature in K, Θᴷ, practical salinity, Sᵖ, applied pressure, Δpᵦₐᵣ, and coefficients, Pᵈⁱᶜₖ₂ᵣ₉₃.\n\nHCO₃⁻ <-> CO₃²⁻ + H⁺\n\nReferences: Roy et al. (1993) – also Handbook (1994)             Millero (1979) pressure correction pH scale  : Total Valid range: T:  0-45  S:  5-45. Note      : converted here from mol/kg-H2O to mol/kg-SW\n\n\n\n\n\n","category":"function"},{"location":"library/internals/#ClimaOceanBiogeochemistry.CarbonSystemSolvers.Fᵈⁱᶜₖ₂ₗ₀₀","page":"Private","title":"ClimaOceanBiogeochemistry.CarbonSystemSolvers.Fᵈⁱᶜₖ₂ₗ₀₀","text":"Fᵈⁱᶜₖ₂ₗ₀₀(Θᴷ, Sᵖ, Δpᵦₐᵣ, Pᵈⁱᶜₖ₂ₗ₀₀)\n\nReturn the second dissociation constant of carbonic acid in mol/kg-SW, given temperature in K, Θᴷ, practical salinity, Sᵖ, applied pressure, Δpᵦₐᵣ, and coefficients, Pᵈⁱᶜₖ₂ₗ₀₀.\n\nHCO₃⁻ <-> CO₃²⁻ + H⁺\n\nReferences: Luecker et al. (2000) – also Handbook (2007)             Millero (1979) pressure correction pH scale:   Total\n\n\n\n\n\n","category":"function"},{"location":"library/internals/#ClimaOceanBiogeochemistry.CarbonSystemSolvers.Fᵈⁱᶜₖ₂ₘ₉₅","page":"Private","title":"ClimaOceanBiogeochemistry.CarbonSystemSolvers.Fᵈⁱᶜₖ₂ₘ₉₅","text":"Fᵈⁱᶜₖ₂ₘ₉₅(Θᴷ, Sᵖ, Δpᵦₐᵣ, Pᵈⁱᶜₖ₂ₘ₉₅)\n\nReturn the second dissociation constant of carbonic acid in mol/kg-SW, given temperature in K, Θᴷ, practical salinity, Sᵖ, applied pressure, Δpᵦₐᵣ, and coefficients, Pᵈⁱᶜₖ₂ₘ₉₅.\n\nHCO₃⁻ <-> CO₃²⁻ + H⁺\n\nReferences: Millero (1995, eq 51 – ln K2(COM))             Millero (1979) pressure correction pH scale:   SWS\n\n\n\n\n\n","category":"function"},{"location":"library/internals/#ClimaOceanBiogeochemistry.CarbonSystemSolvers.Fᶜᵃˡᶜⁱᵗᵉₛₚ","page":"Private","title":"ClimaOceanBiogeochemistry.CarbonSystemSolvers.Fᶜᵃˡᶜⁱᵗᵉₛₚ","text":"Fᶜᵃˡᶜⁱᵗᵉₛₚ(Θᴷ, Sᵖ, Δpᵦₐᵣ, Pᶜᵃˡᶜⁱᵗᵉₛₚ)\n\nReturn the stoichiometric solubility product of calcite, Ω, in seawater, given temperature in K, Θᴷ, practical salinity, Sᵖ, applied pressure, Δpᵦₐᵣ, and coefficients, Pᶜᵃˡᶜⁱᵗᵉₛₚ\n\nReferences: Mucci (1983)             Millero (1995) for pressure correction pH scale  : N/A Units     : (mol/kg-SW)^2\n\n\n\n\n\n","category":"function"},{"location":"library/internals/#ClimaOceanBiogeochemistry.CarbonSystemSolvers.H⁺ₛoverH⁺₃-Tuple{Any, Any, Any}","page":"Private","title":"ClimaOceanBiogeochemistry.CarbonSystemSolvers.H⁺ₛoverH⁺₃","text":"H⁺ₛoverH⁺₃(Θᴷ, Sᵖ, Δpᵦₐᵣ)\n\nReturn the ratio HSWS/Hfree as a @inline function of salinity, Sᵖ.\n\n\n\n\n\n","category":"method"},{"location":"library/internals/#ClimaOceanBiogeochemistry.CarbonSystemSolvers.H⁺ₛoverH⁺ₜ-Tuple{Any, Any, Any}","page":"Private","title":"ClimaOceanBiogeochemistry.CarbonSystemSolvers.H⁺ₛoverH⁺ₜ","text":"H⁺ₛoverH⁺ₜ(Θᴷ, Sᵖ, Δpᵦₐᵣ)\n\nReturn the ratio HSWS/HTot as a @inline function of salinity, Sᵖ. Reference:  Munhoven pH scale:   all\n\n\n\n\n\n","category":"method"},{"location":"library/internals/#ClimaOceanBiogeochemistry.CarbonSystemSolvers.H⁺ₜoverH⁺₃-Tuple{Any, Any, Any}","page":"Private","title":"ClimaOceanBiogeochemistry.CarbonSystemSolvers.H⁺ₜoverH⁺₃","text":"H⁺ₜoverH⁺₃(Θᴷ, Sᵖ, Δpᵦₐᵣ)\n\nReturn the ratio HTot/Hfree as a @inline function of salinity, Sᵖ. Reference:  Munhoven pH scale:   N/A\n\n\n\n\n\n","category":"method"},{"location":"library/internals/#ClimaOceanBiogeochemistry.CarbonSystemSolvers.H₂Oˢʷ","page":"Private","title":"ClimaOceanBiogeochemistry.CarbonSystemSolvers.H₂Oˢʷ","text":"H₂Oˢʷ(Sᵖ, Pᴴ²⁰ˢʷ)\n\nReturn the mass of pure water in one kg of seawater of practical salinity, Sᵖ. References: \"libthdyct\" – derived by Munhoven (1997) from data by Millero (1982)             \"Handbook (2007)\" – Handbook (2007) pH scale:   N/A\n\n\n\n\n\n","category":"function"},{"location":"library/internals/#ClimaOceanBiogeochemistry.CarbonSystemSolvers.SO₄ᵀᴼᵀ","page":"Private","title":"ClimaOceanBiogeochemistry.CarbonSystemSolvers.SO₄ᵀᴼᵀ","text":"SO₄ᵀᴼᵀ(Sᵖ, Pˢᴼ⁴ᵀᴼᵀ)\n\nReturn total sulfate concentration in mol/kg-SW given practical salinity, Sᵖ. References: Morris, A.W. and Riley, J.P. (1966) quoted in Handbook (2007)\n\n\n\n\n\n","category":"function"},{"location":"library/internals/#ClimaOceanBiogeochemistry.CarbonSystemSolvers.μₛ","page":"Private","title":"ClimaOceanBiogeochemistry.CarbonSystemSolvers.μₛ","text":"μₛ(Sᵖ)\n\nReturn ionic strength in mol/kg-SW, for given practical salinity, Sᵖ. References: \"libthdyct\" – derived by Munhoven (1997) from data by Millero (1982)             \"Handbook (2007)\" – Handbook (2007) pH scale:   N/A\n\n\n\n\n\n","category":"function"},{"location":"library/internals/#ClimaOceanBiogeochemistry.CarbonSystemSolvers.AlkalinityCorrectionCarbonSolver.BO₄H₄⁻-Tuple{Any, Any}","page":"Private","title":"ClimaOceanBiogeochemistry.CarbonSystemSolvers.AlkalinityCorrectionCarbonSolver.BO₄H₄⁻","text":"BO₄H₄⁻(pH, Pᶜᵒᵉᶠᶠ)\n\nCalculate borate (B(OH)₄⁻) contribution to Aᶜ using salinity as a proxy\n\n\n\n\n\n","category":"method"},{"location":"library/internals/#ClimaOceanBiogeochemistry.CarbonSystemSolvers.AlkalinityCorrectionCarbonSolver.Fᵖᴴ⁽ᴬᵀ⁺ᵖᶜᵒ²⁾-NTuple{6, Any}","page":"Private","title":"ClimaOceanBiogeochemistry.CarbonSystemSolvers.AlkalinityCorrectionCarbonSolver.Fᵖᴴ⁽ᴬᵀ⁺ᵖᶜᵒ²⁾","text":"Fᵖᴴ⁽ᴬᵀ⁺ᵖᶜᵒ²⁾(Aᵀ, pCO₂, Pᵀ, Siᵀ, pH, Pᶜᵒᵉᶠᶠ)\n\nSolve for ocean DIC given total Alkalinity and pCO₂\n\nEstimate H⁺ (hydrogen ion conc) using estimate of Aᶜ, carbonate alkalinity after (Follows et al., 2006)\n\n\n\n\n\n","category":"method"},{"location":"library/internals/#ClimaOceanBiogeochemistry.CarbonSystemSolvers.AlkalinityCorrectionCarbonSolver.Fᵖᴴ⁽ᴬᵀ⁺ᶜᵀ⁾-NTuple{6, Any}","page":"Private","title":"ClimaOceanBiogeochemistry.CarbonSystemSolvers.AlkalinityCorrectionCarbonSolver.Fᵖᴴ⁽ᴬᵀ⁺ᶜᵀ⁾","text":"Fᵖᶜᵒ²⁽ᴬᵀ⁺ᶜᵀ⁾(Aᵀ, Cᵀ, pH, Pᶜᵒᵉᶠᶠ)\n\nSolve for ocean pCO₂ given total Alkalinity and DIC\n\nEstimate H⁺ (hydrogen ion conc) using estimate of Aᶜ, carbonate alkalinity after (Follows et al., 2006)\n\n\n\n\n\n","category":"method"},{"location":"library/internals/#ClimaOceanBiogeochemistry.CarbonSystemSolvers.AlkalinityCorrectionCarbonSolver.HF-Tuple{Any, Any}","page":"Private","title":"ClimaOceanBiogeochemistry.CarbonSystemSolvers.AlkalinityCorrectionCarbonSolver.HF","text":"HF(pH, Pᶜᵒᵉᶠᶠ)\n\nCalculate the hydrogen fluoride (HF) contribution to Aᶜ\n\n\n\n\n\n","category":"method"},{"location":"library/internals/#ClimaOceanBiogeochemistry.CarbonSystemSolvers.AlkalinityCorrectionCarbonSolver.HPO₄²⁻-Tuple{Any, Any, Any}","page":"Private","title":"ClimaOceanBiogeochemistry.CarbonSystemSolvers.AlkalinityCorrectionCarbonSolver.HPO₄²⁻","text":"HPO₄²⁻(Pᵀ, pH, Pᶜᵒᵉᶠᶠ)\n\nCalculate the monohydrogen phosphate (HPO₄²⁻) contribution to Aᶜ\n\n\n\n\n\n","category":"method"},{"location":"library/internals/#ClimaOceanBiogeochemistry.CarbonSystemSolvers.AlkalinityCorrectionCarbonSolver.HSO₄⁻-Tuple{Any, Any}","page":"Private","title":"ClimaOceanBiogeochemistry.CarbonSystemSolvers.AlkalinityCorrectionCarbonSolver.HSO₄⁻","text":"HSO₄⁻(pH, Pᶜᵒᵉᶠᶠ)\n\nCalculate the hydrogen sulphate (HSO₄⁻) contribution to Aᶜ\n\n\n\n\n\n","category":"method"},{"location":"library/internals/#ClimaOceanBiogeochemistry.CarbonSystemSolvers.AlkalinityCorrectionCarbonSolver.H⁺ᶠʳᵉᵉ-Tuple{Any, Any}","page":"Private","title":"ClimaOceanBiogeochemistry.CarbonSystemSolvers.AlkalinityCorrectionCarbonSolver.H⁺ᶠʳᵉᵉ","text":"H⁺ᶠʳᵉᵉ(pH, Pᶜᵒᵉᶠᶠ)\n\nCalculate the \"Free\" H⁺ contribution to Aᶜ\n\n\n\n\n\n","category":"method"},{"location":"library/internals/#ClimaOceanBiogeochemistry.CarbonSystemSolvers.AlkalinityCorrectionCarbonSolver.H₂PO₄⁻-Tuple{Any, Any, Any}","page":"Private","title":"ClimaOceanBiogeochemistry.CarbonSystemSolvers.AlkalinityCorrectionCarbonSolver.H₂PO₄⁻","text":"H₂PO₄⁻(Pᵀ, pH, Pᶜᵒᵉᶠᶠ)\n\nCalculate the dihydrogen phosphate (H₂PO₄⁻) contribution to Aᶜ\n\n\n\n\n\n","category":"method"},{"location":"library/internals/#ClimaOceanBiogeochemistry.CarbonSystemSolvers.AlkalinityCorrectionCarbonSolver.H₃PO₄-Tuple{Any, Any, Any}","page":"Private","title":"ClimaOceanBiogeochemistry.CarbonSystemSolvers.AlkalinityCorrectionCarbonSolver.H₃PO₄","text":"H₃PO₄(Pᵀ, pH, Pᶜᵒᵉᶠᶠ)\n\nCalculate orthophosphoric acid (H₃PO₄) contribution to Aᶜ\n\n\n\n\n\n","category":"method"},{"location":"library/internals/#ClimaOceanBiogeochemistry.CarbonSystemSolvers.AlkalinityCorrectionCarbonSolver.OH⁻-Tuple{Any, Any}","page":"Private","title":"ClimaOceanBiogeochemistry.CarbonSystemSolvers.AlkalinityCorrectionCarbonSolver.OH⁻","text":"OH⁻(pH, Pᶜᵒᵉᶠᶠ)\n\nCalculate the hydroxide (OH⁻) contribution to Aᶜ\n\n\n\n\n\n","category":"method"},{"location":"library/internals/#ClimaOceanBiogeochemistry.CarbonSystemSolvers.AlkalinityCorrectionCarbonSolver.PO₄³⁻-Tuple{Any, Any, Any}","page":"Private","title":"ClimaOceanBiogeochemistry.CarbonSystemSolvers.AlkalinityCorrectionCarbonSolver.PO₄³⁻","text":"PO₄³⁻(Pᵀ, pH, Pᶜᵒᵉᶠᶠ)\n\nCalculate the phosphate (PO₄³⁻) contribution to Aᶜ\n\n\n\n\n\n","category":"method"},{"location":"library/internals/#ClimaOceanBiogeochemistry.CarbonSystemSolvers.AlkalinityCorrectionCarbonSolver.SiO₄H₃⁻-Tuple{Any, Any, Any}","page":"Private","title":"ClimaOceanBiogeochemistry.CarbonSystemSolvers.AlkalinityCorrectionCarbonSolver.SiO₄H₃⁻","text":"SiO₄H₃⁻(Siᵀ, pH, Pᶜᵒᵉᶠᶠ)\n\nCalculate the silicate (SiO(OH)₃⁻) contribution to Aᶜ\n\n\n\n\n\n","category":"method"},{"location":"library/internals/#ClimaOceanBiogeochemistry.CarbonSystemSolvers.DirectCubicCarbonSolver.Fᵖᴴ⁽ᴬᵀ⁺ᵖᶜᵒ²⁾-NTuple{4, Any}","page":"Private","title":"ClimaOceanBiogeochemistry.CarbonSystemSolvers.DirectCubicCarbonSolver.Fᵖᴴ⁽ᴬᵀ⁺ᵖᶜᵒ²⁾","text":"Fᵖᴴ⁽ᴬᵀ⁺ᵖᶜᵒ²⁾(Aᵀ, pCO₂ᵃᵗᵐ, pH, Pᶜᵒᵉᶠᶠ)\n\nSolve for DIC given total Alkalinity and pCO₂\n\n\n\n\n\n","category":"method"},{"location":"library/internals/#ClimaOceanBiogeochemistry.CarbonSystemSolvers.DirectCubicCarbonSolver.Fᵖᴴ⁽ᴬᵀ⁺ᶜᵀ⁾-NTuple{4, Any}","page":"Private","title":"ClimaOceanBiogeochemistry.CarbonSystemSolvers.DirectCubicCarbonSolver.Fᵖᴴ⁽ᴬᵀ⁺ᶜᵀ⁾","text":"Fᵖᴴ⁽ᴬᵀ⁺ᶜᵀ⁾(Aᵀ, Cᵀ, pH, Pᶜᵒᵉᶠᶠ)\n\nSolve for ocean pCO₂ given total Alkalinity and DIC\n\n\n\n\n\n","category":"method"},{"location":"#ClimaOceanBiogeochemistry","page":"Home","title":"ClimaOceanBiogeochemistry","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"ClimaOceanBiogeochemistry.jl provides biogeochemistry models that integrate with Oceananigans.jl and ClimaOcean.jl.","category":"page"},{"location":"","page":"Home","title":"Home","text":"See also the Oceananigans documentation.","category":"page"},{"location":"","page":"Home","title":"Home","text":"ClimaOceanBiogeochemistry.jl is developed by the Climate Modeling Alliance and heroic external collaborators.","category":"page"},{"location":"#Installation","page":"Home","title":"Installation","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"To add ClimaOceanBiogeochemistry.jl to your local environment, type","category":"page"},{"location":"","page":"Home","title":"Home","text":"julia> using Pkg\n\njulia> Pkg.add(\"https://github.com/CliMA/ClimaOceanBiogeochemistry.jl.git\")","category":"page"},{"location":"library/public/#Public-Documentation","page":"Public","title":"Public Documentation","text":"","category":"section"},{"location":"library/public/","page":"Public","title":"Public","text":"Documentation for ClimaOceanBiogeochemistry.jl's public interface.","category":"page"},{"location":"library/public/","page":"Public","title":"Public","text":"See the Internals section of the manual for internal package docs covering all submodules.","category":"page"},{"location":"library/public/#ClimaOceanBiogeochemistry","page":"Public","title":"ClimaOceanBiogeochemistry","text":"","category":"section"},{"location":"library/public/","page":"Public","title":"Public","text":"Modules = [ClimaOceanBiogeochemistry, \n           ClimaOceanBiogeochemistry.CarbonSystemSolvers,\n           ClimaOceanBiogeochemistry.CarbonSystemSolvers.AlkalinityCorrectionCarbonSolver,\n           ClimaOceanBiogeochemistry.CarbonSystemSolvers.DirectCubicCarbonSolver]\nPrivate = false","category":"page"},{"location":"library/public/#ClimaOceanBiogeochemistry.CarbonSystemSolvers.AlkalinityCorrectionCarbonSolver.AlkalinityCorrectionCarbonSystem-Union{Tuple{}, Tuple{FT}, Tuple{FT, FT}, Tuple{FT, FT, FT}, NTuple{4, FT}, NTuple{5, FT}, NTuple{6, FT}, NTuple{7, FT}, NTuple{8, FT}, NTuple{9, FT}} where FT","page":"Public","title":"ClimaOceanBiogeochemistry.CarbonSystemSolvers.AlkalinityCorrectionCarbonSolver.AlkalinityCorrectionCarbonSystem","text":"AlkalinityCorrectionCarbonSystem(\n        Θ       :: FT = 25.0,\n        Sᴬ      :: FT = 35.0,\n        Δpᵦₐᵣ   :: FT = 0.0,\n        Cᵀ      :: FT = 2050.0e-6,\n        Aᵀ      :: FT = 2350.0e-6,\n        Pᵀ      :: FT = 1.0e-6,\n        Siᵀ     :: FT = 15.0e-6,\n        pH      :: FT = 8.0,\n        pCO₂ᵃᵗᵐ :: FT = 280.0e-6,\n        )\n\nUses the Follows et al (2006) method to solve the distribution of carbon species\n\n\n\n\n\n","category":"method"},{"location":"library/public/#ClimaOceanBiogeochemistry.CarbonSystemSolvers.DirectCubicCarbonSolver.DirectCubicCarbonSystem-Union{Tuple{}, Tuple{FT}, Tuple{FT, FT}, Tuple{FT, FT, FT}, NTuple{4, FT}, NTuple{5, FT}, NTuple{6, FT}, NTuple{7, FT}} where FT","page":"Public","title":"ClimaOceanBiogeochemistry.CarbonSystemSolvers.DirectCubicCarbonSolver.DirectCubicCarbonSystem","text":"DirectCubicCarbonSystem(\n        Θ       :: FT = 25.0,\n        Sᴬ      :: FT = 35.0,\n        Δpᵦₐᵣ   :: FT = 0.0,\n        Cᵀ      :: FT = 2050.0e-6,\n        Aᵀ      :: FT = 2350.0e-6,\n        pH      :: FT = 8.0,\n        pCO₂ᵃᵗᵐ :: FT = 280.0e-6,\n        )\n\nDirectCubicCarbonSolver solves a cubic equation in terms of [H⁺];  Not for serious use, but as a placeholder and for testing purposes\n\n\n\n\n\n","category":"method"}]
